var canvas = document.createElement('canvas');
var context = canvas.getContext('2d');
var nextSpawnTxt = document.getElementById('time');
var inventaireTxt = document.getElementById('container');
var craftTxt = document.getElementById('craftDispo');
var btn = document.getElementById('button');
var keyboard = new Keyboard();
var game = new Game(context);
var lastSpawn = 0;

var tick = function (elapsed) {
	
	if(document.getElementById("player").paused){
	      document.getElementById("player").play();
	}
	if(victoire == false){
		window.requestAnimationFrame(tick);
	}
	if(!paused){
		// clear previous frame
		//this.ctx.clearRect(0, 0, canvasSize, canvasSize);

		// compute delta time in seconds -- also cap it
		var delta = (elapsed - this._previousElapsed) / 1000.0;

		delta = Math.min(delta, 0.25); // maximum delta of 250 ms
		this._previousElapsed = elapsed;


		this.update(delta);

		var time = (Math.floor((20-lastSpawn)*10)/10);
		nextSpawnTxt.innerHTML = "Temps avant le prochain drop d'item : <b>" + (time)  + "</b>";

		if(lastSpawn > 20){
			this.render(true, delta);
			lastSpawn = 0;
			let spawnAudio = new Audio("assets/DROP.mp3");
			spawnAudio.play();

		}else{
			this.render(false, delta);
			lastSpawn += delta;
		}
	}
	
}.bind(game);

function startGame(){

	// start up function
	initItems();
	canvas.width = canvasSize;
	canvas.height = canvasSize;
	canvas.style.position = 'absolute';
	canvas.style.left = "50%";
	canvas.style.top = "5%";
	map.tsize = canvasSize/10;
	document.body.appendChild(canvas);
	nextSpawnTxt.innerHTML = "Temps avant le prochain drop d'item : <b>" + (20-Math.round(lastSpawn*10)/10) + "</b>";
	
	
	game.run();

	
}

